let playlists = [
  {
    id: "104",
    name: "Of Course",
    name_phish: "Rift",
    name_taylorswift: "x",
    name_gratefuldead: "x",
    name_pearljam: "x",
    name_radiohead: "Optimistic",
    standard_duration: "100",
    weighting: "100",
  },
];
export function getPlaylists() {
  return playlists;
}

export function getPlaylist(id) {
  return playlists.find((playlist) => playlist.id === id);
}
